import React from 'react';
import Tracker from './Tracker';

import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";


function App() {


  return (
    <div>
      <Routes>
          <Route path="/" element={Tracker} />
      </Routes>
    </div>
  );
}

export default App;
